  <style>
    * {
      box-sizing: border-box;
      font-size: 14px;
      margin: 0;
      padding: 0;
      font-size: 97.84% !important;
      line-height: 143.48% !important;
    }

    body {
      font-family: Arial, "Helvetica Neue", Helvetica, sans-serif;
      overflow: hidden;
      background-color: #212121;
      font-size: 18px;
      color: #fff;
      max-width: 600px;
      margin: 0 auto
    }

    img {
      width: 100%
    }

    ul {
      list-style-type: none
    }

    .header {
      width: 100%;
      padding: 10px 0 0
    }

    .header__wrapper {
      display: flex;
      align-items: center;
      justify-content: center;
      height: 100%;
      position: relative
    }

    .header__logo {
      line-height: 1;
      position: relative;
      display: flex;
      align-items: center;
      justify-content: center
    }

    .header__logo img {
      width: 80px
    }

    .main {
      padding: 25px 15px
    }

    .main__search {
      background: #2e2f35;
      border-radius: 10px;
      position: relative;
      padding: 20px;
      overflow: hidden;
      margin-bottom: 16px
    }

    .main__search .search-icon {
      position: absolute;
      right: 0;
      top: 0;
      height: 100%;
      padding: 5px 20px;
      background: #f5afa9;
      display: flex;
      align-items: center
    }

    .main__menu {
      background: #2e2f35;
      padding: 10px 0;
      display: flex;
      flex-direction: column;
      align-items: center;
      justify-content: center;
      margin-bottom: 20px
    }

    .main__menu span {
      display: block;
      width: 32px;
      margin-bottom: 5px;
      height: 4px;
      background: #fff
    }

    .main__menu span:last-child {
      margin-bottom: 0
    }

    .main__title {
      text-align: center;
      text-transform: uppercase;
      font-weight: 700;
      margin-bottom: 16px;
      font-size: 1.2rem
    }

    .gallery__item {
      width: 100%;
      margin-bottom: 1rem
    }

    .gallery__item:last-child {
      margin-bottom: 0
    }

    .gallery__item .item__image {
      padding-top: 60%;
      position: relative;
      overflow: hidden;
      border-radius: 10px
    }

    .gallery__item .item__image:before {
      content: '';
      position: absolute;
      top: 50%;
      left: 50%;
      transform: translate(-50%, -50%);
      width: 60px;
      height: 60px;
      background-color: rgba(0, 0, 0, .6);
      border-radius: 50%;
      cursor: pointer;
      z-index: 2
    }

    .gallery__item .item__image:after {
      content: '';
      position: absolute;
      top: 50%;
      left: 50%;
      transform: translate(-50%, -50%);
      width: 0;
      height: 0;
      border-top: 10px solid transparent;
      border-bottom: 10px solid transparent;
      border-left: 16px solid #fff;
      z-index: 3
    }

    .gallery__item .item__image .image {
      position: absolute;
      top: 50%;
      left: 50%;
      transform: translate(-50%, -50%);
      min-height: 100%;
      min-width: 100%
    }

    .gallery__item .item__image .image {
      width: 100%
    }

    .gallery__item .item__title {
      padding: 15px 10px 10px;
      text-align: center;
      font-weight: 700
    }

    .gallery__item .item__info {
      display: flex;
      align-items: center;
      justify-content: space-between;
      padding: 0 10px
    }

    .gallery__item .item__rating {
      padding: 3px 6px 3px 22px;
